#
# TABLE STRUCTURE FOR: ESPACIO_HOSPEDAJE
#

DROP TABLE IF EXISTS `ESPACIO_HOSPEDAJE`;

CREATE TABLE `ESPACIO_HOSPEDAJE` (
  `ID_ESPACIO` varchar(9) COLLATE utf8mb4_unicode_ci NOT NULL,
  `NUM_BANHOS` decimal(2,0) DEFAULT NULL,
  `NUM_CAMAS` decimal(2,0) NOT NULL,
  `TIENE_TERRAZA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ADMITE_FUMADORES` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ADMITE_MASCOTAS` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `CANCELACION_GRATIS` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `MOVILIDAD_ADAPTADA` enum('Sí','No') COLLATE utf8mb4_unicode_ci NOT NULL,
  `PRECIO_NOCHE` decimal(6,1) NOT NULL,
  `LUMINOSIDAD` enum('BAJA','MEDIA','ALTA') COLLATE utf8mb4_unicode_ci NOT NULL,
  `ULTIMA_ACTUALIZACION` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`ID_ESPACIO`),
  CONSTRAINT `ESPACIO_HOSPEDAJE_ibfk_1` FOREIGN KEY (`ID_ESPACIO`) REFERENCES `ESPACIO` (`ID_ESPACIO`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



